/*
 * Table accessor.
 */
idn__joiningtype_t
idn__sparsemap_getjoiningtype(unsigned long v) {
	int idx0, idx1, idx2;

	if (v > UTF32_MAX)
		return (idn__joiningtype_unknown);
	idx0 = v >> (JOININGTYPE_BITS_1 + JOININGTYPE_BITS_2);
	idx1 = (v >> JOININGTYPE_BITS_2) & ((1 << JOININGTYPE_BITS_1) - 1);
	idx2 = v & ((1 << JOININGTYPE_BITS_2) - 1);
	return (idn__joiningtype_t) joiningtype_table[joiningtype_imap[joiningtype_imap[idx0] + idx1]].tbl[idx2];
}
